DROP TABLE IF EXISTS `c_bet`;
CREATE TABLE `c_bet` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `did` varchar(50) NOT NULL COMMENT '订单号',
  `uid` int(11) NOT NULL COMMENT '下注会员ID',
  `username` varchar(50) NOT NULL COMMENT '投注会员',
  `addtime` datetime NOT NULL COMMENT '下注时间',
  `type` varchar(50) NOT NULL COMMENT '所属彩票',
  `qishu` bigint(11) unsigned NOT NULL COMMENT '彩票期数',
  `mingxi_1` varchar(50) NOT NULL COMMENT '玩法分类',
  `mingxi_2` varchar(50) NOT NULL COMMENT '投注内容',
  `odds` double NOT NULL COMMENT '赔率',
  `money` int(10) unsigned NOT NULL COMMENT '投注金额',
  `win` double NOT NULL COMMENT '输赢结果',
  `js` int(1) NOT NULL COMMENT '0=未结算,1=已结算',
  `bet_date` date NOT NULL,
  `jieguo` varchar(50) NOT NULL,
  `fs` double NOT NULL DEFAULT '0',
  `sm` varchar(200) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=418410 DEFAULT CHARSET=utf8 COMMENT='投注单';

